import * as React from 'react'
import { StyleSheet, View } from 'react-native'
import {Text, TextLink, Heading,ThemeProvider, Icon} from '@kiwicom/orbit-react-native';

export default function App (props) {
  return (
    <ThemeProvider>
      <View style={styles.container}>
        <Heading>
          React Native for Web & Next.js
        </Heading>

        <TextLink>
          A universal link
        </TextLink>

        <View>
          <Heading type="title2">
            Subheader
          </Heading>
        </View>

        <View>
          <Icon name="Airplane" />
        </View>
      </View>
    </ThemeProvider>
  )
}

const styles = StyleSheet.create({
  container: {
    alignItems: 'center',
    flexGrow: 1,
    justifyContent: 'center'
  },
  link: {
    color: 'blue'
  },
  textContainer: {
    alignItems: 'center',
    marginTop: 16
  },
  text: {
    alignItems: 'center',
    fontSize: 24,
    marginBottom: 24
  }
})
